  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Lake Wales Ridge NWR for the next 15 years. This
  plan outlines the Refuge vision and purpose and describes how Lake Wales Ridge NWR
  will contribute to the overall mission of the Refuge System. The plan provides an
  introduction to the Refuge, an overview of the CCP process, information about plan
  development and the management direction, and strategies for implementation. Key
  planning issues include: wildlife management, habitat management, visitor services,
  Refuge administration, and wilderness review.\",\n\t\"license_title\": \"License
